import React, { Component } from 'react'
import './index.css'
import Item from '../Item'
export default class List extends Component {

    render(){
        const {updateTodo,deleteTodo,editTodos,filter,todos} = this.props
        return(
                <ul className="todo-main">
                    {
                    showTodos.map(todo => {
                        if (filter === 'complete' && todo.done) {
                            return <Item key={todo.id} {...todo} updateTodo={updateTodo} deleteTodo={deleteTodo} editTodos={editTodos}/>
                        }

                        if (filter === 'undone' && !todo.done) {
                            return <Item key={todo.id} {...todo} updateTodo={updateTodo} deleteTodo={deleteTodo} editTodos={editTodos}/>
                        }

                        if (filter === 'all') {
                            return <Item key={todo.id} {...todo} updateTodo={updateTodo} deleteTodo={deleteTodo} editTodos={editTodos}/>
                        }

                        return null;

                    })
                    }
			    </ul>
        )
    }
}
